.aui-spinner-bars {
    border-radius: 2px;
    height: 20px;
    margin: 0 auto;
    position: relative;
    width: 4px
}

.aui-spinner-bars:after,
.aui-spinner-bars:before {
    border-radius: 2px;
    content: "";
    height: 20px;
    position: absolute;
    top: 0;
    width: 4px
}

.aui-spinner-bars:before {
    left: -6px
}

.aui-spinner-bars:after {
    left: 6px
}

.aui-spinner-bars-bounce-middle {
    animation: bounce-middle .6s ease .1s infinite
}

.aui-spinner-bars-bounce-middle:after,
.aui-spinner-bars-bounce-middle:before {
    top: 50%;
    transform: translateY(-10px) translateZ(0)
}

.aui-spinner-bars-bounce-middle:before {
    animation: bounce-middle .6s ease 0s infinite
}

.aui-spinner-bars-bounce-middle:after {
    animation: bounce-middle .6s ease .2s infinite
}

.wave-ini {
    background-color: #49c6e1;
    border-radius: 50%;
    display: inherit;
    height: 0;
    margin-left: 0;
    margin-top: 0;
    opacity: .7;
    pointer-events: none;
    position: absolute;
    transition: width .5s, height .5s, opacity .5s, margin-left .5s, margin-top .5s;
    transition-timing-function: ease-out;
    width: 0
}

.wave-ini.wave-white {
    background-color: #fff;
    opacity: .5
}

.wave-ini.wave-white-light {
    background-color: #fff;
    opacity: .2
}

.wave-ini.wave-lightGrey {
    background-color: #eee
}

.wave-ini.wave-lightRed {
    background-color: #ff4b39;
    opacity: .2
}

.wave-ini.wave-lightgreen {
    background-color: #73aa01;
    opacity: .2
}

.wave-ini.wave-lightgrey-row,
.wave-ini.wave-lightwhite {
    background-color: #e7dbdb;
    opacity: .2
}

.wave-ini.wave-lightBlue,
.wave-ini.wave-lightdefault {
    background-color: #00c1e2;
    opacity: .2
}

.wave-ini.wave-button-overlay-lightRed {
    background-color: #d13526;
    opacity: .2
}

.wave-ini.wave-button-overlay-lightBlue {
    background-color: #00c1e2;
    opacity: .2
}

.wave-ini.wave-button-help-lightGrey {
    background-color: #6b7e87;
    opacity: .2
}

.wave-ini.wave-button-help-lightSolidgreen {
    background-color: #91d600;
    opacity: .2
}

.wave-ini.wave-start {
    height: 200px;
    margin-left: -100px;
    margin-top: -100px;
    opacity: 0;
    width: 200px
}

.wave-ini.wave-start-small {
    height: 40px;
    margin-left: -20px;
    margin-top: -20px;
    opacity: 0;
    width: 40px
}

body {
    overflow-y: auto
}

.text-lower-capitalize {
    text-transform: lowercase
}

.text-lower-capitalize:first-letter {
    text-transform: uppercase
}

span.text-lower-capitalize {
    display: inline-block
}

.text-lower {
    text-transform: lowercase
}

.text-upper {
    text-transform: uppercase
}


.aui-core-iframe {
    border: none;
    height: calc(100% - 150px);
    position: absolute;
    width: 100%
}

.aui-core-iframe-wrapper {
    height: calc(100% - 150px);
    top: 150px
}

.aui-core-iframe-wrapper-maximized {
    height: 100%;
    position: fixed;
    top: 0;
    width: 100%;
    z-index: 3001
}

.aui-core-iframe-wrapper-maximized .aui-core-iframe {
    height: 100%
